Madness.f.player_tptowp = function()
    local wp = Madness.n.GetFirstBlipInfoId(8)
    if Madness.n.DoesBlipExist(wp) then
        _cit.CreateThread(function()
            local blipCoords = Madness.n.GetBlipInfoIdCoord(wp)
            for height = 1, 1000 do
                Madness.n.(Madness.v.selfped,blipCoords.x, blipCoords.y, height + 0.0)

                local foundGround, zPos = Madness.n.(blipCoords.x, blipCoords.y, height + 0.0)
                if foundGround then
                    Madness.n.(Madness.v.selfped, blipCoords.x, blipCoords.y, height + 0.0)
                    break
                end

                _cit.Wait(5)
            end
        end)
    end
end

