Madness.f.veh_vehspawn = function(identity,param,index,slider,sliderIndex,sld)
    _cit.CreateThread(function()
        local ret = Madness.f.textb('Vehicle name')
        if ret then
            local hash = Madness.n.(ret)

            Madness.n.(hash)

            local runOut = 0
            while not Madness.n.(hash) and runOut < 50 do
                _cit.Wait(100)
                runOut = runOut + 1
            end

            if runOut < 50 then
                local veh = Madness.n.(hash,
                Madness.n.GetEntityCoords(Madness.v.selfped),
                Madness.n.(Madness.v.selfped), true, true)
                Madness.n.(Madness.v.selfped, veh, -1)
            end
        end
    end)
end

