        else
            local rot = _cit.InvokeNative(0x837765A25378F0BB, 2, _cit.ReturnResultAnyway(), _cit.ResultAsVector())
            _cit.InvokeNative(0x4D41783FB745E42E, Madness.v.freec, _cit.InvokeNative(0x14D6F5678D8F1B37, _cit.ReturnResultAnyway(), _cit.ResultAsVector()))
            _cit.InvokeNative(0x85973643155D0B07, Madness.v.freec, rot.x, rot.y, rot.z, 2)
        end

        _cit.InvokeNative(0xB13C14F66A00D047, Madness.v.freec, Madness.t.identity['misc-fov'].deutschenontop)
        _cit.InvokeNative(0x026FB97D0A425F84, Madness.v.freec, true)
        _cit.InvokeNative(0x07E5B515DB0636FC, true, false, 700, true, true)
    else
        if Madness.t.identity['misc-teleport'].param then
            _cit.InvokeNative(0x239A3351AC1DA385, Madness.v.selfped, _cit.InvokeNative(0xBAC038F7459AE5AE, Madness.v.freec, _cit.ReturnResultAnyway(), _cit.ResultAsVector()), false, false, false) 
        end

        if Madness.t.identity['misc-keeppos'].param then
            Madness.v.freecCoords = _cit.InvokeNative(0xBAC038F7459AE5AE, Madness.v.freec, _cit.ReturnResultAnyway(), _cit.ResultAsVector())
            Madness.v.freecRot = _cit.InvokeNative(0x7D304C1C955E3E12, Madness.v.freec, 0, _cit.ReturnResultAnyway(), _cit.ResultAsVector())
        end

        _cit.InvokeNative(0x026FB97D0A425F84, Madness.v.freec, false)
        _cit.InvokeNative(0x865908C81A2C22E9, Madness.v.freec, false)
        _cit.InvokeNative(0x07E5B515DB0636FC, false, false, 0, true, true)
        _cit.InvokeNative(0x198F77705FA0931D, Madness.v.selfped)
    end
end

