                Madness.n.DrawRect(Madness.t.menu['server'].x + Madness.t.menu['players'].x, Madness.t.menu['server'].y + Madness.t.menu['players'].y, Madness.t.menu['players'].w + 0.002, Madness.t.menu['players'].h + 0.003, 70, 70, 70, 100)
                Madness.n.DrawRect(Madness.t.menu['server'].x + Madness.t.menu['players'].x, Madness.t.menu['server'].y + Madness.t.menu['players'].y, Madness.t.menu['players'].w, Madness.t.menu['players'].h, 0, 0, 0, 200)
                local plys = Madness.n.()

                if #plys ~= Madness.v.plys then
                    Madness.v.plys, Madness.t.splayers = #plys, {}

                    for k,v in pairs(Madness.t.menu['players']) do
                        if type(v) == 'table' then
                            table.remove(Madness.t.menu['players'], k)
                        end
                    end

                    for k,v in pairs(Madness.n.()) do
                        table.insert(Madness.t.splayers, Madness.n.(v))
                    end

                    for k,svid in Madness.f.spairs(Madness.t.splayers) do
                        local identity = 'server-plylistply' .. svid
                        local t = {title = '[' .. svid .. '] ' .. string.sub(Madness.n.(
                        Madness.n.GetPlayerFromServerId(svid)), 0, 23), identity = identity, opt = Madness.f.checkbox, param = false, func = Madness.f.server_ply_list, id = svid}
                        table.insert(Madness.t.menu['players'], t)
                        Madness.t.identity[identity] = t
                    end

                    for k,v in pairs(Madness.t.addedPlys) do
                        local skip = false
                        for _k,_v in pairs(Madness.t.menu['players']) do
                            if _v.id == v then
                                _v.param = true
                                skip = true
                            end
                        end

                        if not skip then
                            table.remove(Madness.t.addedPlys, k)
                        end
                    end
                end
            end

            if Madness.t.identity['server-triggerlist'].param then
                Madness.n.DrawRect(Madness.t.menu['server'].x + Madness.t.menu['triggers'].x, Madness.t.menu['server'].y + Madness.t.menu['triggers'].y, Madness.t.menu['triggers'].w + 0.002, Madness.t.menu['triggers'].h + 0.003, 70, 70, 70, 100)
                Madness.n.DrawRect(Madness.t.menu['server'].x + Madness.t.menu['triggers'].x, Madness.t.menu['server'].y + Madness.t.menu['triggers'].y, Madness.t.menu['triggers'].w, Madness.t.menu['triggers'].h, 0, 0, 0, 200)
            end

            Madness.n.DrawRect(Madness.t.menu['main'].x, Madness.t.menu['main'].y, Madness.t.menu['main'].w + 0.002, Madness.t.menu['main'].h + 0.003, 70, 70, 70, 100)
            Madness.n.DrawRect(Madness.t.menu['main'].x, Madness.t.menu['main'].y, Madness.t.menu['main'].w, Madness.t.menu['main'].h, 0, 0, 0, 180)

            Madness.v.pressing = false
            if Madness.n.IsDisabledControlPressed(0, 24) then
                Madness.v.pressing = true
            end

            Madness.v.click = false
            if Madness.n.IsDisabledControlJustReleased(0, 24) then
                Madness.v.click = true
            end

            Madness.v.press, Madness.v.sliderzz = false, nil
            for _k,_v in pairs(Madness.t.menu) do
                local isShit = _k == 'players' and Madness.t.identity['server-plylist'].param or _k == 'triggers' and Madness.t.identity['server-triggerlist'].param
                if _v.show or isShit  then
                    if _v.title then
                        Madness.f.drawtext(string.upper(_v.title), _v.x, _v.y - 0.0185, 4, 0.5, true, 255, 255, 255, 255, true)
                        Madness.n.DrawSprite('mpentry', 'mp_modenotselected_gradient', _v.x, _v.y, _v.w + 0.06, _v.h + 0.02, 0.0, 255, 255, 255, 255)
                        Madness.n.DrawSprite('mpentry', 'mp_modenotselected_gradient', _v.x, _v.y, _v.w + 0.06, _v.h + 0.02, 0.0, 255, 255, 255, 255)
                        Madness.n.DrawSprite('mpentry', 'mp_modenotselected_gradient', _v.x, _v.y, _v.w + 0.06, _v.h + 0.02, 0.0, 255, 255, 255, 255)
                        Madness.n.DrawRect(_v.x, _v.y + 0.025, _v.w, 0.001, Madness.t.identity['opts-menur'].sldcolor[1] + 50, Madness.t.identity['opts-menur'].sldcolor[2], Madness.t.identity['opts-menur'].sldcolor[3] + 50, 200)
                    end

                    if not _v.closed then
                        if _v.title then
                            Madness.n.DrawRect(_v.x, _v.y + 0.225, _v.w, 0.4, 0, 0, 0, 200)
                        end

                        _v.options, _v.actOps = 0, 0
                        if type(_v) == 'table' then
                            for k,v in ipairs(_v) do
                                if _v.actOps == 0 and v.opt == Madness.f.slider then
                                    Madness.v.sliderzz = v.identity
                                end

                                if _v.options <= _v.scrollo2 + _v.scrollo and _v.options >= _v.scrollo then
                                    local x, y = _v.x, _v.y
                                    if _k == 'main' then
                                        y = _v.y - 0.1375 + 0.0402 * _v.options
                                        Madness.n.DrawRect(_v.x, y + 0.028, 0.008, 0.003, Madness.t.menu[v.param].show and Madness.t.identity['opts-menur'].sldcolor[1] or 200, Madness.t.menu[v.param].show and Madness.t.identity['opts-menur'].sldcolor[2] or 200, Madness.t.menu[v.param].show and Madness.t.identity['opts-menur'].sldcolor[3] or 200, 255)
                                    elseif _k == 'players' or _k == 'triggers' then
                                        x, y = Madness.t.menu['server'].x + Madness.t.menu[_k].x - 0.045, Madness.t.menu['server'].y + Madness.t.menu[_k].y - 0.22 + 0.021 * _v.actOps
                                    else
                                        x, y = _v.x - 0.075, _v.y + 0.025 + 0.021 * _v.actOps
                                    end

                                    local ret = v.opt(_k, k, v.title, x, y, v.param)
                                    if ret then
                                        if ret == 'checkbox' then
                                            v.param = not v.param
                                        end

                                        if v.func then
                                            v.func(v.identity, v.param, v.index, v.slideropts, v.deutschenontop, v.sld)
                                        end
                                    end
                                    _v.actOps = _v.actOps + 1
                                end

                                _v.options = _v.options + 1
                            end
                        end
                        if _v.options > _v.scrollo2 + 1 and not isShit then
                            Madness.v.scollin = false
                            local a = (0.0208 * _v.actOps)
                            local s = _v.actOps/_v.options * a
                            local drawposY = _v.y + 0.029 + s/2 + (a-s) * (_v.scrollo)/(_v.options - _v.scrollo2 - 1)
                            Madness.n.DrawRect(_v.x + 0.0817, _v.y + 0.029 + a/2, 0.0022, a, 0, 0, 0, 200)
                            Madness.n.DrawRect(_v.x + 0.0817, drawposY, 0.0022, s, 150, 150, 150, 255)
                            local bounds = Madness.f.bounds(_v.x + 0.0817, drawposY, 0.0022, s)

                            if not Madness.v.holdslider then
                                local cont = Madness.f.tablecontains(Madness.t.holdScroll, _k)

                                if Madness.v.pressing and (bounds or cont) then
                                    if not cont then
                                        table.insert( Madness.t.holdScroll, _k );
                                    end

                                    local y = Madness.f.clamp(0, a - s, Madness.v.relcy - (_v.y + 0.029 + s/2))
                                    _v.scrollo = math.floor((y/(a-s)) * (_v.options - _v.scrollo2 - 1))

                                    Madness.v.scollin = true
                                elseif cont and not Madness.v.pressing or bounds then
                                    local found = Madness.f.tablefind(Madness.t.holdScroll, _k)
                                    if found ~= false then
                                       table.remove(Madness.t.holdScroll, found);
                                    end
                                end
                            end
                        end
                        if not Madness.v.hoveringcombo and Madness.f.bounds(isShit and Madness.t.menu['server'].x + _v.x or _v.x, (isShit and Madness.t.menu['server'].y + _v.y or _v.y) + (0.021 * _v.actOps)/2, _v.w, _v.h + 0.021 * _v.actOps) then
                            if Madness.n.IsDisabledControlJustPressed(0, 16) then
                                _v.scrollo = _v.scrollo + 1
                                _v.scrollo = Madness.f.clamp(0, _v.options - _v.scrollo2 - 1, _v.scrollo)
                            elseif Madness.n.IsDisabledControlJustPressed(0, 17) then
                                _v.scrollo = _v.scrollo - 1
                                _v.scrollo = Madness.f.clamp(0, _v.options - _v.scrollo2 - 1, _v.scrollo)
                            end
                        end
                    end
                end
            end

            if not Madness.v.press and not Madness.v.holdslider and Madness.n.IsDisabledControlJustPressed(0, 24, true) then
                if Madness.f.bounds(Madness.t.menu['main'].x, Madness.t.menu['main'].y, Madness.t.menu['main'].w, Madness.t.menu['main'].h) then
                    Madness.v.dragging = Madness.t.menu['main']
                elseif Madness.v.write and Madness.f.bounds(Madness.v.txtx, Madness.v.txty, 0.15, 0.26) then
                    Madness.v.dragging = {x = Madness.v.txtx, y = Madness.v.txty}
                elseif Madness.f.bounds(Madness.t.menu['player'].x, Madness.t.menu['player'].y, Madness.t.menu['player'].w, Madness.t.menu['player'].h) then
                    Madness.v.dragging = Madness.t.menu['player']
                elseif Madness.f.bounds(Madness.t.menu['car'].x, Madness.t.menu['car'].y, Madness.t.menu['car'].w, Madness.t.menu['car'].h) then
                    Madness.v.dragging = Madness.t.menu['car']
                elseif Madness.f.bounds(Madness.t.menu['weapon'].x, Madness.t.menu['weapon'].y, Madness.t.menu['weapon'].w, Madness.t.menu['weapon'].h) then
                    Madness.v.dragging = Madness.t.menu['weapon']
                elseif Madness.f.bounds(Madness.t.menu['visuals'].x, Madness.t.menu['visuals'].y, Madness.t.menu['visuals'].w, Madness.t.menu['visuals'].h) then
                    Madness.v.dragging = Madness.t.menu['visuals']
                elseif Madness.f.bounds(Madness.t.menu['server'].x, Madness.t.menu['server'].y, Madness.t.menu['server'].w, Madness.t.menu['server'].h) then
                    Madness.v.dragging = Madness.t.menu['server']
                elseif Madness.f.bounds(Madness.t.menu['misc'].x, Madness.t.menu['misc'].y, Madness.t.menu['misc'].w, Madness.t.menu['misc'].h) then
                    Madness.v.dragging = Madness.t.menu['misc']
                elseif Madness.f.bounds(Madness.t.menu['options'].x, Madness.t.menu['options'].y, Madness.t.menu['options'].w, Madness.t.menu['options'].h) then
                    Madness.v.dragging = Madness.t.menu['options']
                elseif Madness.f.bounds(Madness.t.menu['server'].x + Madness.t.menu['players'].x, Madness.t.menu['server'].y + Madness.t.menu['players'].y, Madness.t.menu['players'].w, Madness.t.menu['players'].h) then
                    Madness.v.dragging = Madness.t.menu['players']
                elseif Madness.f.bounds(Madness.t.menu['server'].x + Madness.t.menu['triggers'].x, Madness.t.menu['server'].y + Madness.t.menu['triggers'].y, Madness.t.menu['triggers'].w, Madness.t.menu['triggers'].h) then
                    Madness.v.dragging = Madness.t.menu['triggers']
                end

                if Madness.v.dragging then
                    Madness.v.ox = Madness.v.dragging.x - Madness.v.relcx
                    Madness.v.oy = Madness.v.dragging.y - Madness.v.relcy

                    if Madness.n.GetGameTimer() <= (Madness.v.dragTimer or 0) then
                        Madness.v.dragging.closed = not Madness.v.dragging.closed
                    end
                end
            elseif Madness.v.dragging and Madness.n.IsDisabledControlJustReleased(0, 24, true) then
                if Madness.v.write then Madness.v.txtx, Madness.v.txty = Madness.v.dragging.x, Madness.v.dragging.y end
                Madness.v.dragging = nil
                Madness.v.dragTimer = Madness.n.GetGameTimer() + 100
            end

            if Madness.v.dragging then
                Madness.v.dragging.x = Madness.v.relcx + Madness.v.ox
                Madness.v.dragging.y = Madness.v.relcy + Madness.v.oy
                if Madness.v.write then Madness.v.txtx, Madness.v.txty = Madness.v.dragging.x, Madness.v.dragging.y end
            end

            Madness.v.hoveringcombo = false
        end
    end
end)

Madness.f.skels = function(ped, color)
    local r = Madness.n.(ped, 0x0, 0.0, 0.0, 0.0)
    local o = Madness.f.pedSize(r, ped == Madness.v.selfped)
    local rightknee = Madness.n.(ped, 0x3FCF, 0.0, 0.0, 0.0, o);
    local leftknee = Madness.n.(ped, 0xB3FE, 0.0, 0.0, 0.0, o);
    local neck = Madness.n.(ped, 0x9995, 0.0, 0.0, 0.0, o);
    local head = Madness.n.(ped, 0x796E, 0.0, 0.0, 0.0, o);
    local pelvis = Madness.n.(ped, 0x2E28, 0.0, 0.0, 0.0, o);
    local rightFoot = Madness.n.(ped, 0xCC4D, 0.0, 0.0, 0.0, o);
    local leftFoot = Madness.n.(ped, 0x3779, 0.0, 0.0, 0.0, o);
    local rightUpperArm = Madness.n.(ped, 0x9D4D, 0.0, 0.0, 0.0, o);
    local leftUpperArm = Madness.n.(ped, 0xB1C5, 0.0, 0.0, 0.0, o);
    local rightForeArm = Madness.n.(ped, 0x6E5C, 0.0, 0.0, 0.0, o);
    local leftForeArm = Madness.n.(ped, 0xEEEB, 0.0, 0.0, 0.0, o);
    local rightHand = Madness.n.(ped, 0xDEAD, 0.0, 0.0, 0.0, o);
    local leftHand = Madness.n.(ped, 0x49D9, 0.0, 0.0, 0.0, o);
    Madness.n.DrawLine(head, neck, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(neck, pelvis, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(pelvis, rightknee, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(pelvis, leftknee, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(rightknee, rightFoot, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(leftknee, leftFoot, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(neck, rightUpperArm, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(neck, leftUpperArm, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(rightUpperArm, rightForeArm, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(leftUpperArm, leftForeArm, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(rightForeArm, rightHand, color.r, color.g, color.b, color.a)
    Madness.n.DrawLine(leftForeArm, leftHand, color.r, color.g, color.b, color.a)
end

Madness.f.box = function(ped, color)
    local top = Madness.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, 1.0)
    local bottom = Madness.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, -1.0)

    local ret, sx, sy = Madness.n.GetScreenCoordFromWorldCoord(top.x, top.y, top.z)
    local ret2, sx2, sy2 = Madness.n.GetScreenCoordFromWorldCoord(bottom.x, bottom.y, bottom.z)

    if ret and ret2 then
        local x = (sy - sy2) / 4
        Madness.n.DrawRect(0 + x / 2, 0, 1 / Madness.v.rx, sy - sy2, color.r, color.g, color.b, color.a)
        Madness.n.DrawRect(0 - x / 2, 0, 1 / Madness.v.rx, sy - sy2, color.r, color.g, color.b, color.a)

        local y = sy - sy2
        Madness.n.DrawRect(0, 0 + y / 2, (sy - sy2) / 4, 1 / Madness.v.ry, color.r, color.g, color.b, color.a)
        Madness.n.DrawRect(0, 0 - y / 2, (sy - sy2) / 4, 1 / Madness.v.ry, color.r, color.g, color.b, color.a)
    end
end

Madness.f.boxfill = function(ped, color)
    local top = Madness.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, 1.0)
    local bottom = Madness.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, -1.0)

    local ret, sx, sy = Madness.n.GetScreenCoordFromWorldCoord(top.x, top.y, top.z)
    local ret2, sx2, sy2 = Madness.n.GetScreenCoordFromWorldCoord(bottom.x, bottom.y, bottom.z)

    if ret and ret2 then
        Madness.n.DrawRect(0, 0, (sy - sy2) / 4, sy - sy2, color.r, color.g, color.b, color.a)
    end
end

Madness.f.healthbar = function(ped, color)
    local top = Madness.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, 1.0)
    local bottom = Madness.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, -1.0)

    local h =  (Madness.n.(ped)-100)/(Madness.n.(ped) - 100)
    local ph = Madness.f.clamp(0, 1, h)

    local ret, sx, sy = Madness.n.GetScreenCoordFromWorldCoord(top.x, top.y, top.z)
    local ret2, sx2, sy2 = Madness.n.GetScreenCoordFromWorldCoord(bottom.x, bottom.y, bottom.z)

    if ret and ret2 then
        local x = 0 + (sy - sy2) / 4 / 2 - 2 / Madness.v.rx
        local pixel = 1 / Madness.v.rx
        local y = sy - sy2
        Madness.n.DrawRect(x, 0, pixel, y, 0, 0, 0, 255)
        Madness.n.DrawRect(x, 0 - y/2 + (y*ph - pixel)/2, pixel, -1* y*ph + pixel, color.r, color.g, color.b, color.a)
    end
end

Madness.f.armorbar = function(ped, color)
