Madness.f.visuals = function()
    if Madness.t.identity['vis-enable'].param then
        for i=1, #Madness.v.peds do
            local ped = Madness.v.peds[i];
            if (ped) and (Madness.n.(ped))
            and (Madness.t.identity['vis-npc'].param or Madness.n.IsPedAPlayer(ped)) and (ped ~= Madness.v.selfped or Madness.t.identity['vis-self'].param) and
            (not Madness.t.identity['vis-onlyalive'].param or Madness.n.(ped) > 0) then
                local dist = Madness.n.(Madness.v.selfcoords, Madness.n.GetEntityCoords(ped, true));
                local maxdist = 150;
                if Madness.t.identity['vis-dist_enable'].param then
                    maxdist = Madness.t.identity['vis-dist_val'].deutschenontop;
                end
                if dist < maxdist then
                    if Madness.t.identity['vis-lines'].param then
                        Madness.f.lines(ped, Madness.t.identity['vis-lines'].color)
                    end

                    if Madness.n.(ped) then
                        if Madness.t.identity['vis-skel'].param then
