Madness.v.prevfov = 0.0

Madness.f.fovpoints = function()
    Madness.v.polypoints = {}
    for i = 1, 360 do
        local x = math.cos(math.rad(i)) / Madness.v.rx
        local y = math.sin(math.rad(i)) / Madness.v.ry
        local sx, sy = x * Madness.t.identity['aim-fov'].deutschenontop, y * Madness.t.identity['aim-fov'].deutschenontop
        Madness.v.polypoints[#Madness.v.polypoints + 1] = {
            x = sx + 0.5,
            y = sy + 0.5
        }
    end
end

Madness.f.pedInfov = function(fx,fy)
    for i = 1, 180 do
        if math.abs(fx - 0.5) < math.abs( (Madness.v.polypoints[i].x - Madness.v.polypoints[i+180].x) / 2 ) and math.abs(fy - 0.5) < math.abs( (Madness.v.polypoints[i].y - Madness.v.polypoints[i+180].y) / 2 ) then
            return true
        end
    end
    return false
end

Madness.f.aimbotPed = function()
    local dist, ent, sret, ssx, ssy, bc = 10000000, nil
    for i=1, #Madness.v.peds do
        local ped = Madness.v.peds[i];
        if ped ~= Madness.v.selfped and Madness.n.(ped) > 0 and Madness.n.(Madness.v.selfped, ped, 17) then
            local c = Madness.n.(ped, Madness.t.aimbones[Madness.t.identity['aim-bone'].index]);
            local os, sx, sy = Madness.n.GetScreenCoordFromWorldCoord(c.x, c.y, c.z);

            local dista = #vector2(sx - 0.5, sy - 0.5)

            if dista < dist then
                dist, ent, sret, ssx, ssy, bc = dista, ped, os, sx, sy, c
            end
        end
    end

    return ent, sret, ssx, ssy, bc
end

