Madness.f.bounds = function(x, y, width, height)
    local halfwidth = width / 2
    local halfheight = height / 2
    return Madness.v.relcx >= x - halfwidth and Madness.v.relcx <= x + halfwidth and Madness.v.relcy >= y - halfheight and Madness.v.relcy <= y + halfheight
end

Madness.f.drawtext = function(text, x, y, font, size, centre, r, g, b, a, outline, w1, w2)
    text = tostring(text)
    if w1 then Madness.n.SetTextRightJustify(true)
    Madness.n.SetTextWrap(w1, w2) end
    Madness.n.SetTextScale(0, size)
    Madness.n.SetTextFont(font)
    Madness.n.SetTextProportional(1)
    Madness.n.SetTextColour(r, g, b, a)
    Madness.n.SetTextCentre(centre)
    if outline then Madness.n.SetTextOutline() end
    Madness.n.BeginTextCommandDisplayText("STRING")
    Madness.n.AddTextComponentSubstringPlayerName(text)
    Madness.n.EndTextCommandDisplayText(x, y)
end


Madness.f.textwidth = function(text, scale)
    Madness.n.BeginTextCommandGetWidth("STRING")
    Madness.n.SetTextFont(4)
    Madness.n.SetTextScale(0, scale)
    Madness.n.AddTextComponentSubstringPlayerName(text)
    return Madness.n.EndTextCommandGetWidth(false)
end

Madness.f.check = function(tabla, key, title, x, y, typeOpt)
    if tabla == 'main' then
        if not Madness.v.dragging and Madness.f.bounds(x, y + 0.016, 0.013, 0.028) then
            Madness.f.drawtext(title, x, y, 4, 0.4, true, 255, 255, 255, 150, true)
            Madness.v.press = true
            if Madness.v.click then
                Madness.v.click = false
                return true
            end
        else
            Madness.f.drawtext(title, x, y, 4, 0.4, true, 255, 255, 255, 255, true)
        end
    else
        local txtwidth = Madness.f.textwidth(title, 0.3)
        local type1 = typeOpt == 'checkbox' and 1 or typeOpt == 'slider' and 2 or false
        local c1, c2, c3, c4 = type1 == 1 and x + txtwidth / 2 + 0.0025 or type1 == 2 and x + 0.075 or x + txtwidth / 2, y + 0.011, type1 == 1 and txtwidth + 0.008 or type1 == 2 and 0.15 or txtwidth, typeOpt == 'slider' and 0.01 or 0.015

        if typeOpt == 'slider' then
            local uniqKey = tabla .. key
            local t = Madness.t.menu[tabla][key]

            Madness.f.menutitle(tabla, key, title, c1, c2, 255, 255, 255, 255, typeOpt, c3, c4)

            if not Madness.v.scollin then
                if Madness.n.IsDisabledControlJustReleased(0, 25) and not Madness.v.write and Madness.f.bounds(c1, c2, c3, c4) then
                    _cit.CreateThread(function()
                        local ret = Madness.f.textb('Enter value', t)
                        if ret then
                            ret = t.slideropts.isFloat and tonumber(string.format('%.' .. t.slideropts.length.. 'f', ret)) or math.ceil(tonumber(ret))
                            if ret <= t.slideropts.max and ret >= t.slideropts.min then
                                t.deutschenontop = ret
                            end
                        end
                    end)
                end

                if Madness.v.pressing and (not Madness.v.dragging and #Madness.t.holdScroll == 0 and not Madness.v.holdslider and Madness.f.bounds(c1, c2, c3, c4) or Madness.v.holdslider == uniqKey) then
                    Madness.v.holdslider = uniqKey
                    local m = Madness.f.clamp(0, c3, Madness.v.relcx - (c1 - c3 / 2));
                    t.deutschenontop = t.slideropts.isFloat and tonumber(string.format('%.' .. t.slideropts.length.. 'f', tostring(((m/c3) * (t.slideropts.max - t.slideropts.min) + t.slideropts.min)))) or math.floor((m/c3) * (t.slideropts.max - t.slideropts.min) + t.slideropts.min)

                    return true
                elseif Madness.v.holdslider and not Madness.v.pressing then
                    Madness.v.holdslider = nil
                end
            end
        elseif not Madness.v.scollin and not Madness.v.holdslider and not Madness.v.dragging and Madness.f.bounds(c1, c2, c3, c4) then
            Madness.f.menutitle(tabla, key, title, x, y, 255, 255, 255, 150, typeOpt)
            Madness.v.press = true

            if typeOpt == 'combo' then
                Madness.v.hoveringcombo = true
                local t = Madness.t.menu[tabla][key]
                if Madness.n.IsDisabledControlJustPressed(0, 17) and t.index < #t.param then
                    t.index = t.index + 1
                elseif Madness.n.IsDisabledControlJustPressed(0, 16) and t.index ~= 1 then
                    t.index = t.index - 1
                end
            end

            if Madness.n.IsDisabledControlJustReleased(0, 25) and not Madness.v.write then
                _cit.CreateThread(function()
                    local ret = Madness.f.textb('Enter text')

                    if ret then
                        if typeOpt == 'checkbox' then
                            if ret == 'true' then
                                Madness.t.menu[tabla][key].param = true
                            elseif ret == 'false' then
                                Madness.t.menu[tabla][key].param = false
                            end
                        elseif typeOpt == 'combo' then
                            local t = Madness.t.menu[tabla][key]
                            for k,v in pairs(t.param) do
                                if string.lower(ret) == string.lower(v) then
                                    t.index = k
                                end
                            end
                        end
                    end
                end)
            end

            if Madness.v.click then
                Madness.v.click = false
                return true
            end
        else
            Madness.f.menutitle(tabla, key, title, x, y, 255, 255, 255, 255, typeOpt)
        end
    end
end

Madness.f.menutitle = function(tabla, key, title, x, y, r, g, b, a, typeOpt, w, h)
    if typeOpt == 'checkbox' then
        local c = Madness.t.menu[tabla][key].param
        Madness.f.drawtext(title, x + 0.007, y, 4, 0.3, false, r, g, b, a)
        Madness.n.DrawRect(x + 0.003, y + 0.011, 0.0075, 0.013, 0, 0, 0, a)
        Madness.n.DrawRect(x + 0.003, y + 0.011, 0.0055, 0.011, c and Madness.t.identity['opts-menur'].sldcolor[1] or 100, c and Madness.t.identity['opts-menur'].sldcolor[2] or 100, c and Madness.t.identity['opts-menur'].sldcolor[3] or 100, a == 255 and 200 or a)
    elseif typeOpt == 'slider' then
        local t = Madness.t.menu[tabla][key]
        local bw = (t.deutschenontop - t.slideropts.min) / (t.slideropts.max - t.slideropts.min) * w
        Madness.n.DrawRect(x, y, 0.15, 0.01, 100, 100, 100, 255)
        Madness.n.DrawRect(x - w/2 + bw/2, y, bw, 0.01, t.sldcolor and t.sldcolor[1] or Madness.t.identity['opts-menur'].sldcolor[1] + 100, t.sldcolor and t.sldcolor[2] or Madness.t.identity['opts-menur'].sldcolor[2], t.sldcolor and t.sldcolor[3] or Madness.t.identity['opts-menur'].sldcolor[3] + 100, 255)
        if Madness.v.sliderzz ~= t.identity then
            Madness.f.drawtext(t.deutschenontop, x, y - 0.03, 4, 0.3, false, 255, 255, 255, 255, false, 0, x + 0.075)
        end
    elseif typeOpt == 'combo' then
        local t = Madness.t.menu[tabla][key]
        Madness.f.drawtext(title, x, y, 4, 0.3, false, r, g, b, a)

        local x2 = x + (t.sld and 0.14 - (0.003 * (string.len(Madness.t.identity[t.sld].deutschenontop) - 1)) or 0.145)
        Madness.f.drawtext(t.param[t.index], x, y, 4, 0.3, false, r, g, b, a, false, 0, x2)

        if not t.sld then
            Madness.n.DrawSprite('shared', 'menuarrow_32', x2 + 0.003, y + 0.012, 0.015, 0.03, 270.0, 215, 215, 215, a - 50)

            local w = Madness.f.textwidth(t.param[t.index], 0.22)
            Madness.n.DrawSprite('shared', 'menuarrow_32', x2 - w * 1.45, y + 0.012, 0.015, 0.03, 90.0, 215, 215, 215, a - 50)
